// src/components/AvailableJobs.js
import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';

const AvailableJobs = ({ profileFilter, paygradeFilter, timeFilter }) => {
  const [availableJobs, setAvailableJobs] = useState([]);

  useEffect(() => {
    // Fetch available jobs with filters from the backend API
    axios.get(`/api/jobs?profile=${profileFilter}&paygrade=${paygradeFilter}&time=${timeFilter}`)
      .then(response => setAvailableJobs(response.data))
      .catch(error => console.error(error));
  }, [profileFilter, paygradeFilter, timeFilter]);

  return (
    <div>
      <h2>Available Jobs</h2>
      <ul>
        {availableJobs.map(job => (
          <li key={job._id}>
            <Link to={`/jobs/${job._id}`}>{job.title}</Link>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default AvailableJobs;
